Elegant Angel is delighted to release the trailer to Buttwoman Returns starring Alexis Texas. Following in the footsteps of Tianna, Tiffany Mynx, Belladonna, and Brianna Love, last year, Alexis Texas was crowned Elegant Angel's new Buttwoman. ...    Full DescriptionThis year the big butt superstar returns as only the second girl, after Tianna, to appear in a second Buttwoman movie focused entirely on herself. The movie stars Ava Rose, Jayden Jaymes, Cherokee, and Charley Chase.
